  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `fund_code, time` (`fund_code`,`time`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

